import { base64ToUint8, mungeSoundFont } from 'ember-audio/utils';
import { module, test } from 'qunit';

module('Unit | Utility | decode base64', function () {
  const soundfont = `if (typeof(MIDI) === "undefined") var MIDI = {};if (typeof(MIDI.Soundfont) === "undefined") MIDI.Soundfont = {};MIDI.Soundfont.acoustic_grand_piano = {"A0": "data:audio/mpeg;base64,",}`;
  const munged = JSON.parse(
    `{"A0": ""}`
  );

  test('base64ToUint8 works', function (assert) {
    let result = base64ToUint8(munged.A0);
    assert.ok(result);
  });

  test('base64ToUint8 returns a Uint8Array', function (assert) {
    let result = base64ToUint8(munged.A0);
    assert.ok(result instanceof Uint8Array);
  });

  test('mungeSoundFont works', function (assert) {
    let result = mungeSoundFont(soundfont);
    assert.deepEqual(result, munged);
  });
});
